import React,{Component} from 'react';
import styled from 'styled-components';
import Header from './component/header';
import WrapperStyled from './component/Wrapper';

const AppStyled = styled.main`
 background-image: radial-gradient(circle at top, ,blue 50%);
 min-height: 100vh; 
 padding: 3rem 0;  
`


class App extends Component {
 render(){
   return (
     <AppStyled> <WrapperStyled><Header/> </WrapperStyled>   </AppStyled> 

   );
 }


}



export default App;
